import React from 'react'

function MyAccount() {

  const userComponents = users.map((eachUser) => {
    return (
      <MyAccount 
        key={eachUser.id}
        {...eachUser}
      />
    )
  })

  return (
    <div>MyAccount</div>
  )
}

export default MyAccount
